import React, { useState, useEffect } from "react";
import axios from "axios";

function DesenvolvedoresList({ onDelete }) {
  const [editedDevId, setEditedDevId] = useState(null);
  const [editedDev, setEditedDev] = useState({ nome: "", hobby: "" });
  const [devList, setDevList] = useState([]);
  const [searchQuery, setSearchQuery] = useState("");

  useEffect(() => {
    const fetchDevelopers = async () => {
      try {
        const response = await axios.get(`http://localhost:3002/api/desenvolvedores`, {
          params: { q: searchQuery }
        });
        const data = response.data;
        setDevList(data);
      } catch (error) {
        console.error("Erro ao buscar desenvolvedores:", error);
      }
    };

    fetchDevelopers();
  }, [searchQuery]);

  const handleEdit = (dev) => {
    setEditedDevId(dev.id);
    setEditedDev({ nome: dev.nome, hobby: dev.hobby });
  };

  const handleSave = async () => {
    try {
      await axios.put(
        `http://localhost:3002/api/desenvolvedores/${editedDevId}`,
        editedDev
      );
      setDevList((prevDevs) =>
        prevDevs.map((dev) =>
          dev.id === editedDevId
            ? { ...dev, nome: editedDev.nome, hobby: editedDev.hobby }
            : dev
        )
      );
      setEditedDevId(null);
    } catch (error) {
      console.error("Erro ao editar o desenvolvedor:", error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:3002/api/desenvolvedores/${id}`);
      setDevList(devList.filter((dev) => dev.id !== id));
    } catch (error) {
      console.error("Erro ao excluir o desenvolvedor:", error);
    }
  };

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  return (
    <div className="w-full mx-auto p-4 bg-gray-600 rounded-md shadow-md">
      <h2 className="text-2xl font-sans font-bold text-white text-center mb-4">
        Lista de Desenvolvedores
      </h2>
      <input
        type="text"
        value={searchQuery}
        onChange={handleSearchChange}
        placeholder="Buscar desenvolvedor..."
        className="px-4 py-2 mb-4 rounded-md shadow-sm bg-gray-700 text-white w-full"
      />
      {devList.length === 0 ? (
        <p className="text-white text-center">Nenhum resultado encontrado.</p>
      ) : (
        <table className="w-full">
          <thead>
            <tr className="bg-gray-800 text-white">
              <th className="px-4 py-2">ID</th>
              <th className="px-4 py-2">Nome</th>
              <th className="px-4 py-2">Sexo</th>
              <th className="px-4 py-2">Data de Nascimento</th>
              <th className="px-4 py-2">Idade</th>
              <th className="px-4 py-2">Hobby</th>
              <th className="px-4 py-2">Nível</th>
              <th className="px-4 py-2">Ações</th>
            </tr>
          </thead>
          <tbody>
            {devList.map((dev) => (
              <tr key={dev.id} className="bg-gray-700 text-white">
                <td className="px-4 py-2">{dev.id}</td>
                <td className="px-4 py-2">
                  {editedDevId === dev.id ? (
                    <input
                      type="text"
                      name="nome"
                      value={editedDev.nome}
                      onChange={(e) => setEditedDev({ ...editedDev, nome: e.target.value })}
                      className="px-2 py-1 mb-1 rounded-md shadow-sm bg-gray-800 text-white w-full"
                    />
                  ) : (
                    <span>{dev.nome}</span>
                  )}
                </td>
                <td className="px-4 py-2">{dev.sexo}</td>
                <td className="px-4 py-2">{new Date(dev.data_nascimento).toLocaleDateString()}</td>
                <td className="px-4 py-2">{dev.idade}</td>
                <td className="px-4 py-2">
                  {editedDevId === dev.id ? (
                    <input
                      type="text"
                      name="hobby"
                      value={editedDev.hobby}
                      onChange={(e) => setEditedDev({ ...editedDev, hobby: e.target.value })}
                      className="px-2 py-1 mb-1 rounded-md shadow-sm bg-gray-800 text-white w-full"
                    />
                  ) : (
                    <span>{dev.hobby}</span>
                  )}
                </td>
                <td className="px-4 py-2">{dev.nivel}</td>
                <td className="px-4 py-2">
                  {editedDevId === dev.id ? (
                    <button
                      onClick={handleSave}
                      className="bg-violet-400 hover:bg-violet-500 text-white px-2 py-1 rounded-md mr-2"
                    >
                      Salvar
                    </button>
                  ) : (
                    <div className="flex">
                      <button
                        onClick={() => handleEdit(dev)}
                        className="bg-blue-400 hover:bg-blue-500 text-white px-2 py-1 rounded-md mr-2"
                      >
                        Editar
                      </button>
                      <button
                        onClick={() => handleDelete(dev.id)}
                        className="bg-red-400 hover:bg-red-500 text-white px-2 py-1 rounded-md"
                      >
                        Excluir
                      </button>
                    </div>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default DesenvolvedoresList;
